  [],\n\t\"num_tags\": 0,\n\t\"name\": \"hab114-0402b-habitat-polygons-for-cape-flattery-and-makah-bay-area-results-from-hmpr-114-2004-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Benthic habitat polygon coverages are being
  created for the Olympic Coast National Marine Sanctuary (OCNMS). ROV, towed camera
  sled, bathymetry data, sedimentary samples, and sonar mapping have been integrated
  to describe the geological, biological, and oceanographic aspects of habitat. OCNMS
  has collected side scan sonar, multibeam bathymetry, bottom grab and video data
  to produce polygon coverages describing the benthic habitat for survey HMPR-114-2004-02b.
  The habitat polygons have attributes for megahabitat, bottom induration, mesohabitat,
  macrohabitat and biology (where direct observations are available),polygon area
  and perimeter.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
